import React from 'react';

const Card = (prop) => {
	return(
		<div className = 'tc bg-light-yellow dib br2 ba b--black pa1 ma2 grow bw1 shadow-5'>
			<img src={`https://robohash.org/${prop.id}?200x200`} alt='Robot'/>
			<div>
				<h2>{prop.name}</h2>
				<p>{prop.email}</p>
			</div>
		</div>
	);
}

export default Card;
